import './App.css';
import { BrowserRouter, Route } from 'react-router-dom';
import Nome from './pages/Nome';
import Preferencia from './pages/Preferencia';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Route exact path='/' component= { Nome } />
        <Route exact path='/preferencia' component= { Preferencia } />
      </div>
    </BrowserRouter>
  );
}

export default App;
